import React, {Component} from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link,
    useParams
  } from "react-router-dom";


function Product() {
    let { slug } = useParams();
  return (
    <>
        <div>
        <h3>ID: {slug}</h3>
        </div>
    </>
  );
}



export default class Products extends Component {
  render() {
    return (
      <>
        <Product />
      </>
    )
  }
}
